import React, {  useState } from 'react'
import '../css/LoginSignUp.css'

export default function FormLogin() {

    const [form , setForm] = useState({})
    const [showLogin , setShowLogin] = useState(true)


    const handleOnChange = (e)=>{
        e.preventDefault()
        // console.log(e.target.name , e.target.value)
        setForm({
          ...form , [e.target.name] : e.target.value  
        })
    }

    const handleOnSignUp =async (e)=>{
        e.preventDefault()
        console.log(form)

    // ----------------------------------------------Now we will post the data

       const data = await fetch('http://127.0.0.1:8000/Users' , {
            method:'POST',
            body:JSON.stringify(form),
            headers:{
                "Content-type":"application/json"
            }

        })
        console.log(data)

        const res = await data.json()
        console.log(res)

    }

    // How can we get all the data

//     const handleToGetAllData = async()=>{

//         const AllUser = await fetch('http://127.0.0.1:8000/Users' , {
//             method:'GET'
//         })

//         const res = await AllUser.json()
//         setList(res.data.users)
//         console.log(res.data.users)

//     }

//     useEffect(()=>{
//         handleToGetAllData()
//     },[])



// const render = list.map((data,index)=>{
//     return <div key={index}>
//         <p>{data.username}</p>
//     </div>
// })

  return (
    <>
    
    <div className="signInBox">

    <ul class="nav nav-pills nav-justified mb-3" id="ex1" role="tablist">
  <li class="nav-item" role="presentation">
    <a class="nav-link active" id="tab-login" data-mdb-toggle="pill" href="#pills-login" role="tab"
      aria-controls="pills-login" aria-selected="true">Login</a>
  </li>
  <li class="nav-item" role="presentation">
    <a class="nav-link" id="tab-register" data-mdb-toggle="pill" href="#pills-register" role="tab"
      aria-controls="pills-register" aria-selected="false">Register</a>
  </li>
</ul>


<div class="tab-pane fade show active" id="pills-login" role="tabpanel" aria-labelledby="tab-login">
    <form>
      <div class="text-center mb-3">
        <p>Sign in with:</p>
        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-facebook-f"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-google"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-twitter"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-github"></i>
        </button>
      </div>

      <p class="text-center">or:</p>

      {/* <!-- Email input --> */}
      <div class="form-outline mb-4">
        <input type="email" id="loginName" class="form-control" />
        <label class="form-label" for="loginName">Email or username</label>
      </div>

      {/* <!-- Password input --> */}
      <div class="form-outline mb-4">
        <input type="password" id="loginPassword" class="form-control" />
        <label class="form-label" for="loginPassword">Password</label>
      </div>

      {/* <!-- 2 column grid layout --> */}
      <div class="row mb-4">
        <div class="col-md-6 d-flex justify-content-center">
          {/* <!-- Checkbox --> */}
          <div class="form-check mb-3 mb-md-0">
            <input class="form-check-input" type="checkbox" value="" id="loginCheck" checked />
            <label class="form-check-label" for="loginCheck"> Remember me </label>
          </div>
        </div>

        <div class="col-md-6 d-flex justify-content-center">
          {/* <!-- Simple link --> */}
          <a href="#!">Forgot password?</a>
        </div>
      </div>

      {/* <!-- Submit button --> */}
      <button type="submit" class="btn btn-primary btn-block mb-4">Sign in</button>

      {/* <!-- Register buttons --> */}
      <div class="text-center">
        <p>Not a member? <a href="#!">Register</a></p>
      </div>
    </form>
  </div>


    </div>

    <div className="container formBox">
    {/* <!-- Pills navs --> */}

    {/* {showLogin? } */}


  {/* Signup */}
  <div class="tab-pane fade" id="pills-register" role="tabpanel" aria-labelledby="tab-register">
    <form>
      <div class="text-center mb-3">
        <p>Sign up with:</p>
        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-facebook-f"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-google"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-twitter"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-github"></i>
        </button>
      </div>

      <p class="text-center">or:</p>

